import React, {useState} from 'react'
import { Button } from 'react-bootstrap';
import Form from 'react-bootstrap/Form';
import Stack from 'react-bootstrap/Stack';

export default function Input() {

  const [title, setTitle] = useState('')
  const [detail, setDetail] = useState('')

  function amendValue(e){
    setTitle(e.target.value)
  }

  return (
    <>
      <h1 className='mt-5'>Todo List</h1>
      <Stack gap={2} className="mx-auto mt-2">
        <Form.Control className="me-auto" placeholder="Add your mission title" value={title} onChange={amendValue}/>
        <Form.Control className="me-auto" placeholder="Add your mission detail" value={detail} onChange={amendValue}/>
        <Button variant="secondary">Submit</Button>
      </Stack>
    </>
  )
}
